import React from 'react'
import loginImg from '../assets/loginPage.jpg'

function LoginPage() {
  return (
    <div className='row.g-0.justify-content-center.align-items-center'>
     <div className='col-10'></div>
     <div className='col-6'>
      <img src={loginImg} />
     </div>
    </div>
  )
}

export default LoginPage
